  04> PUTT, Henry Richard (Harry)
  b 11.06.1960
  Henry b. at Hornsby, Sydney, Australia. Address: 28 Riverview Avenue, Dangar Island, NSW 2083,
  Australia.
  Harry was educated in Special Language classes at Waitara (Sydney) Primary School, and at North
  Ryde and Gordon West and Thealgreen Comprehensive School, Reading Berks. He was then accepted
  for the Mary Hare Grammar School for the Deaf, Newbury, Berks, England, where he studied for
  three years. On his return to Australia he attended the Australian International Independent
  School, Sydney and then continued his studies at Meadowbank Technical College, Sydney, where he
  trained as a fitter. He has worked as a fitter and at various other occupations and is at
  present retraining as an electronics technician.
  05> PUTT, Sarah Ethel Jane m on 15.09.1983 to MURRAY, Michael Thomas
  (Mick)
  b 25.11.1962
  b 02.09.1960
  Sarah b. at Hornsby, Sydney, Australia. Michael, s/o Thomas and Helen Murray. Address: 65
  Burdett Street, Hornsby 2077, NSW, Australia.
  Sarah was educated at Waitara (Sydney) Primary School, Overdown Road Borough School, Reading,
  Berks, Hornsby Girls' High School, the Australian International Independent School and the Ryde
  School of Horticulture. She has a Diploma in Nursery Trade Practice, has taught aerobics and
  worked at various other jobs. Mick and Sarah have their own landscape gardening business.
  Sarah is at present studying for a Diploma in Applied Science (Landscape).
  Mick trained as a spray painter but as soon as he finished his apprenticeship he retrained
  himself as a landscape gardener. He is a qualified Landscape Technician.
